import React from 'react';

const Volunteer = () => {
	return (
			<section id="section1" style={{ height: "100vh" }}>
				<h3>We are volunteers who want to give back to the community around us and support health care workers in this time of uncertainty, by providing meals for themselves and their family members.</h3>
                <p>
What can you do?
We are currently recruiting volunteers to assist with the following roles:

Delivery Drivers:
Picking up prepared meals in bulk from our kitchen sites
Driving to delivery location at hospitals, clinics etc.
Dropping off bulk prepared meals as a non-contact delivery driver

Kitchen and Food Preparation:
Assist in food preparation and packaging
Assist with general kitchen duties</p>
			</section>
	)
}


export default Volunteer;
